import Image1 from "../../assets/MERN.png";
import Image2 from "../../assets/React_logo.png";
import Image3 from "../../assets/React_logo.png";

export const Data = [
  {
    id: 1,
    image: Image1,
    title: "Crud Operation",
    subtitle:"MERN",
    description:
      "Create, Read, Update, and Delete (CRUD) are the four basic operations of persistent storage.",
  },
  {
    id: 2,
    image: Image2,
    title: "Invoice Generator",
    subtitle:"Reactjs",
    description:
      "Basic frontend application who generate invoice bill with using reactjs technology",
  },
  {
    id: 3,
    image: Image3,
    title: "To-Do List ",
    subtitle:"Reactjs",
    description:
      "A to-do list is just a list of things you have to-do. That means basically anything and everything can be on your to-do list—but just because you've written your to-dos down doesn't mean your to-do list is actually useful.",
  },
];
